import React from 'react';

const Exercicio2 = ({ posts, name }) => {
  return (
    <div>
      {name}
      {posts.map((item) => (
        <div key={item.id}>
          <li>{item.title}</li>
          <li>{item.content}</li>
        </div>
      ))}
    </div>
  );
};  
export default Exercicio2;
